import React from "react";

function Skill() {
    return (
        <div className="skill">
            <h2>Skills</h2>
            <p>C++</p>
            <p>Python</p>
            <p>React</p>
            <p>HTML</p>
            <p>CSS</p>
            <p>JavaScript</p>
        </div>
    );
}

export default Skill;
